const Title = ({ children }) => {
    if (typeof children !== 'string') {
        console.error('props.children must be a string');
        return null;
    }

    // const m = children.split(' ');


    // console.log(b, 'b')

    const [q, ...rest] = children.split(' ');
    const b = (<span className="font-bold">{q}</span>)

    return (
        <div className="inline-block md:pr-20 border-b border-mpred mb-4">
            <h3 className="text-lg">{b} {rest.join(' ')}</h3>
        </div>
    )
}

export default Title;
